// src/components/VennDiagramComponent.js
import React, { useEffect, useRef, useState } from "react";
import * as d3 from "d3";
import venn from "venn.js";

const VennDiagramComponent = () => {
  const vennRef = useRef(null);
  const [data, setData] = useState(null);

  useEffect(() => {
    // Load data from the .txt file
    d3.text("./data/venn_out_data.txt").then((data) => {
      // Parse the data
      const parsedData = d3.dsvFormat("\t").parse(data);
      setData(parsedData);
    });
  }, []);

  useEffect(() => {
    if (!data) return;

    // Helper function to get the most common protein and its count
    const getMostCommonProtein = (data, column) => {
      const proteinCounts = data.reduce((acc, d) => {
        if (d[column] !== "NA") {
          acc[d[column]] = (acc[d[column]] || 0) + 1;
        }
        return acc;
      }, {});
      const mostCommonProtein = Object.keys(proteinCounts).reduce(
        (a, b) => (proteinCounts[a] > proteinCounts[b] ? a : b),
        null
      );
      return {
        protein: mostCommonProtein,
        count: proteinCounts[mostCommonProtein] || 0,
      };
    };

    // Filter the data based on columns
    const commonAB = data
      .filter((d) => d["Common A B"] !== "NA")
      .map((d) => d["Common A B"]);
    const uniqueA = data
      .filter((d) => d["Unique A"] !== "NA")
      .map((d) => d["Unique A"]);
    const uniqueB = data
      .filter((d) => d["Unique B"] !== "NA")
      .map((d) => d["Unique B"]);

    // Construct URLs for salivaryproteome.org
    const salivaryProteomeBaseUrl = "https://salivaryproteome.org/protein/";

    const sets = [
      {
        sets: ["A"],
        size: uniqueA.length,
        link: getMostCommonProtein(data, "Unique A").protein
          ? `${salivaryProteomeBaseUrl}${encodeURIComponent(
              getMostCommonProtein(data, "Unique A").protein
            )}`
          : "",
        data: uniqueA,
      },
      {
        sets: ["B"],
        size: uniqueB.length,
        link: getMostCommonProtein(data, "Unique B").protein
          ? `${salivaryProteomeBaseUrl}${encodeURIComponent(
              getMostCommonProtein(data, "Unique B").protein
            )}`
          : "",
        data: uniqueB,
      },
      {
        sets: ["A", "B"],
        size: commonAB.length,
        link: getMostCommonProtein(data, "Common A B").protein
          ? `${salivaryProteomeBaseUrl}${encodeURIComponent(
              getMostCommonProtein(data, "Common A B").protein
            )}`
          : "",
        data: commonAB,
      },
    ];

    // Create the Venn diagram
    const vennDiagram = venn.VennDiagram().width(600).height(400);
    const chart = d3.select(vennRef.current).datum(sets).call(vennDiagram);

    // Select the tooltip element
    const tooltip = d3.select("#tooltip-venn");

    chart
      .selectAll("path")
      .attr("class", "venn-circle")
      .on("mouseover", function (event, d) {
        d3.select(this)
          .transition("tooltip")
          .duration(400)
          .style("fill-opacity", 0.8);
        tooltip.transition().duration(400).style("display", "block");
        const sets = d.sets.join(" & ");
        const size = d.size;
        const mostCommon = getMostCommonProtein(
          data,
          sets === "A" ? "Unique A" : sets === "B" ? "Unique B" : "Common A B"
        );

        tooltip.html(`
          Sets: ${sets}<br>
          Size: ${size}<br>
          Most Common Protein: ${mostCommon.protein || "None"}<br>
          Count: ${mostCommon.count}
        `);
      })
      .on("mousemove", function (event) {
        tooltip
          .style("left", event.pageX + 15 + "px")
          .style("top", event.pageY - 28 + "px");
      })
      .on("mouseout", function () {
        d3.select(this)
          .transition("tooltip")
          .duration(400)
          .style("fill-opacity", 0.5);
        tooltip.transition().duration(400).style("display", "none");
      })
      .on("click", function (event, d) {
        if (d.link) {
          window.open(d.link, "_blank");
        }
      });

    // Modify the Venn diagram labels
    chart.selectAll("text").attr("class", function (d) {
      if (d.sets.includes("A")) {
        return "venn-label venn-label-A";
      } else if (d.sets.includes("B")) {
        return "venn-label venn-label-B";
      } else {
        return "venn-label";
      }
    });
  }, [data]);

  return (
    <div>
      <h2>Venn Diagram</h2>
      <div id="venDiagram" ref={vennRef}></div>
      <div
        id="tooltip-venn"
        style={{
          position: "absolute",
          display: "none",
          background: "#fff",
          border: "1px solid #ccc",
          padding: "10px",
        }}
      ></div>
    </div>
  );
};

export default VennDiagramComponent;
